import React from 'react';
import Title from '../../components/Title/Title';
import MainContent from '../../components/MainContent/MainContent';

const HomePage = () => {
    return (
        <div>
            <Title
                titleText={"Página Home"}
                additionalClass={'margem-acima'}
            />
        </div>
    );
};

export default HomePage;
